import React from 'react';

function App() {
    return (
        <div>
            <h1>خوش آمدید به برنامه آب و هوا!</h1>
            <p>
                برای مشاهده اطلاعات آب و هوا، لطفاً به وب‌سایت 
                <a 
                    href="https://openweathermap.org" 
                    target="_blank" 
                    rel="noopener noreferrer"
                >
                    OpenWeatherMap
                </a> 
                مراجعه کنید.
            </p>
        </div>
    );
}

export default App;
